    "2016-03-17T20:52:16.411506",nt"name": "water-wastewater-information-system-and-records-database",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of Water/Wastewater Information
    System and Records Database is to track the progress of water supply and wastewater
    construction projects, including those being financed through the State Revolving
    Fund (SRF). The Department of Natural Resourcesu2019 Water Quality Bureau has the
    responsibility of reviewing projects, permitting water supply and wastewater construction,
    and facilitating SRF approvals. From water main installation to major drinking water
    treatment plant upgrades, from sewer extensions to new wastewater facilities, DNR
    staff work with applicants around the state to ensure that important public health
    and environmental protection goals are met.rnrnThe public search function allows
    access to information about projects, including project managers, permits, approvals,
    and overall status.",nt"license_title": "License Not Specified",nt"extras":
